import React, { Suspense } from "react";
import ReactDOM from "react-dom";
import App from "./App";
import SimpleReactLightbox from "simple-react-lightbox";

ReactDOM.render(
  <SimpleReactLightbox>
    <Suspense fallback={<span>Loading...</span>}></Suspense>
    <App />
  </SimpleReactLightbox>,
  document.getElementById("root")
);
